import React from "react";
import { Container, Card } from "react-bootstrap";

function Report() {
    return (
        <>
            <Card>
                <Card.Header as="h1">Report an Infection</Card.Header>
                <Card.Body>This is some text within a card body.</Card.Body>
            </Card>
        </>
    );
}

export default Report;
